import { Container, Row, Col } from "react-bootstrap";
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
import meter1 from "../assets/img/meter1.svg";
import meter2 from "../assets/img/meter2.svg";
import meter3 from "../assets/img/meter3.svg";
import fiftycent from "../assets/img/50%.svg";
import sixtycent from "../assets/img/60%.svg";
import sixtyfivecent from "../assets/img/65%.svg";
import colorSharp from "../assets/img/color-sharp.png";
import { render } from "@testing-library/react";
export const Skills = () => {
    const responsive = {
        superLargeDesktop: {
          // the naming can be any, depends on you.
            breakpoint: { max: 4000, min: 3000 },
            items: 5
        },
        desktop: {
            breakpoint: { max: 3000, min: 1024 },
            items: 3
        },
        tablet: {
            breakpoint: { max: 1024, min: 464 },
            items: 2
        },
        mobile: {
            breakpoint: { max: 464, min: 0 },
            items: 1
        }
    };

    const skills = ['Java', 'JavaScript','MySQL','DataBase', 'Angular', 'React', 'Css', 'HTML5', 'Scss']
    const arrayImg = [meter1,meter2,meter3]

    function render(array) {
        array.forEach(element => {
            <div className="item">
                <img src={meter1} alt="Image"/>
                <h5>{element}</h5>
            </div>
        });
    }

    return (
        <section className="skill" id="skills">
            <Container>
                <Row>
                    <Col className="col-12">
                        <div className="skill-bx wow zoomIn">
                            <h2>Skills</h2>
                            <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.
                                <br></br> Lorem Ipsum has been the industry's standard dummy text.
                            </p>
                            <Carousel responsive={responsive} infinite={true} className="skill-slider owl-carousel owl-theme">

                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5>Java</h5>
                                </div>
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5>JavaScript</h5>
                                </div>
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5>Angular</h5>
                                </div>
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5>React</h5>
                                </div>
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5></h5>
                                </div>
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5>Web Development</h5>
                                </div>
                                <div className="item">
                                    <img src={meter2} alt="Image"/>
                                    <h5>Brand Identify</h5>
                                </div>
                                <div className="item">
                                    <img src={meter3} alt="Image"/>
                                    <h5>Logo Desing</h5>
                                </div>
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5>Web Development</h5>
                                </div>
                            </Carousel>
                        </div>
                    </Col>
                </Row>
            </Container>
            <img className="background-image-left" src={colorSharp} alt="Image"/>
        </section>
    )
}
